import React from 'react';
function Stats() {
    return ( 
        <div className='container'>
            <div className='row'>
                <div className='col'>
                    <h1>Trust with confidence</h1>
                    
                </div>
                <div className='col'>
                    <img src='media/ecoSystem.png' style={{width:"75%"}} alt='ecoSystem'/>
                </div>
            </div>
        </div>
    );
}

export default Stats;
